    require(msg.sender == getOwner(), "Ownable: Caller is not the owner");

    // Validate buyLimit
    require(buyLimit == (buyLimit * denominator) / denominator || denominator == 0, "Invalid buy limit");
    require(buyLimit >= 10000, "Buy limit must be at least 10000");

    // Validate sellLimit
    require(sellLimit == (sellLimit * denominator) / denominator || denominator == 0, "Invalid sell limit");
    require(sellLimit >= 10000, "Sell limit must be at least 10000");

    // Validate walletLimit
    require(walletLimit == (walletLimit * denominator) / denominator || denominator == 0, "Invalid wallet limit");
    require(walletLimit >= 10000, "Wallet limit must be at least 10000");

    // Update limits
    _maxxTrxSize = (buyLimit * denominator) / 10000;
    _maxxTransferSize = (sellLimit * denominator) / 10000;
    _maxxWalletSize = (walletLimit * denominator) / 10000;
}

